Inside 9-11 - Guiliani's 9-11: When The Towers Fell

Closely looks at the events and aftermath of 9-11 from the view on the ground and the emergency responses, using the frame of Mayor Guiliani's actions, decisions and management. A bit too much Guiliani, but gives a good view of the situation facing the responders, rather than focusing on the terrorists.
